**ANFIS architecture**

![The-ANFIS-Architecture.png](data:image/png;base64,)

**Layer 1**: each node $i$ in this layer is a square node with a node function:
\begin{align}
\text{$O_i^1=μ_{Ai}(x)$}
\end{align}
The parameters of the membership functions are called premise
parameters. 

**Layer 2**: each node $i$ in this layer is a circle node, which
multiplies the incoming signals and sends the product (or other T-norm)
out.
\begin{align}
\text{$w_i^1=μ_{Ai}(x) \times μ_{Bi}(x), \quad i=1,2$}
\end{align}
Each node output represents the firing strength of a rule.

**Layer 3**: each node $i$ in this layer is a circle node. The $i$-th
node calculates the ratio of the $i$-th rule’s firing strength to the sum of all
rules’ firing strengths: The outputs of this layer are called normalized firing strengths.

\begin{align}
\text{$\bar{w_i}=\frac{w_i}{w_1 + w_2}, \quad i=1,2$}
\end{align}

**Layer 4**: each node $i$ in this layer is a square node with a node function
\begin{align}
\text{$0_i^4=\bar{w_i}f_i = a_ix_1 + b_ix_2 + r_i$}
\end{align}

where $\bar{w_i}$ is the output of layer 3 and $a_i$, $b_i$, and $r_i$ are the so-called consequent parameters. 

**Layer 5**: the single node in this layer is a circle node
which computes the overall output as the summation of all incoming
signals, i.e.,
\begin{align}
\text{$0_i^5=\sum_{i}\bar{w_i}f_i = \frac{\sum_{i}\bar{w_i}f_i}{\sum_{i}\bar{w_i}}$}
\end{align}

